import { Link } from "react-router-dom";

export default function InSession({ weekday, date, djName }) {
  return (
    <section className="in-session-box">
      <article className="in-session-text">
        <h1>In Session Now</h1>
        <h2>{djName}</h2> {/* Displays the DJ currently playing */}
        <h3>{weekday}, {date}</h3> {/* Displays the event date */}
        <p>Experience an unforgettable night with {djName}.</p>
        <Link
          to="/reserve"
          className="in-session-button"
          target="_blank"
          rel="noopener noreferrer"
        >
          Reserve Now
        </Link>
      </article>
      <section className="in-session-image">
        <img
          src={require("../../../assets/art-cover.jpg")}
          alt="In-Session Cover"
        />
      </section>
    </section>
  );
}
